import React, {Fragment} from 'react'
import SectionTitle from "./includes/SectionTitle";
import Card from "./Card";

const AboutSec = () => (
  <Fragment>
    <div className='AboutSec'>
      <div className="container">
        <SectionTitle subject='關於卡利'/>
        <div className='subTitle'>亞洲最新興的博彩娛樂集團</div>
        <div className="row">
          <Card />
          <Card />
          <Card />
          <Card />

        </div>
      </div>
    </div>
    <style jsx>{
      `
          .subTitle{
            color: #fff;
            font-size: 2.125rem;
            margin: 0 auto 20px;
          }
          .AboutSec::after {
          content: "";
          background: url(images/AboutSecBg.png) no-repeat;
          background-size: cover;
          opacity: 0.32;
          top: 0;
          left: 0;
          bottom: 0;
          right: 0;
          position: absolute;
          z-index: -1;  
          filter: blur(3px); 
          }
          .AboutSec {
          padding: 0 0 25px;  
          position: relative;
          z-index: 0;
          background: rgba(0,0,0,.65);
          }`
    }

    </style>
  </Fragment>
);

export default AboutSec
